import React,{Component} from 'react';

export class Home extends Component {
    
    render(){

        let tag = ""
        const search = () => {
          console.log(tag)
        }

        return(
            <div class="container mt-3">
            <div class="row">
              <div class="col">
              </div>
              <div class="col-8">
                  <div className="input-group mb-3">
                  <input type="text" value={tag} className="form-control" placeholder="Recipient's username" aria-label="Search Tag" aria-describedby="button-addon2"/>
                  <button className="btn btn-outline-secondary" onClick={search} type="button" id="button-addon2">Search</button>
                  </div>
              </div>
              <div class="col">
              </div>
            </div>
          </div>
        )
    }
}
